import "./App.css";
import { Container } from "react-bootstrap";
import "./components/fil.css";
import Row from "react-bootstrap";
import Col from "react-bootstrap";
// import component
import Navb from "./components/Nav";
import Hero from "./components/Hero";

function App() {
  return (
    <Container>
      <Navb />
      <Row>
        <Hero />
      </Row>
    </Container>
  )
}

export default App;
